#include <iostream>#include <vector>#include <algorithm>using namespace std;vector<int> h;int main() {	int t,a,b;	int sum = 0;	for (int i = 0; i < 9; i++) {		cin >> t;		h.push_back(t);		sum += h[i];	}	for (int i = 0; i < 8; i++) {		for (int j = i+1; j < 9; j++) {			if (sum - (h[i] + h[j]) == 100) {				a = i;				b = j;			}		}	}	h.erase(h.begin() + a);	h.erase(h.begin() + b - 1);	sort(h.begin(), h.end());	for (int i = 0; i < 7; i++) {		cout << h[i]<<endl;	}}